export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},RP4LLEGbKD:{data:{id:2159,attributes:{imdbId:"tt0247638",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzcwYjEwMzEtZTZmMi00ZGFhLWJhZjItMDAzNDVkNjZmM2U5L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"49%"},{Source:"Metacritic",Value:"52\u002F100"}],item_lang:{data:{id:2822,attributes:{title:g,plot:"Mia Thermopolis (Anne Hathaway) is the average teenager - sweet, a little geeky, and pretty much invisible to everyone with the exception of her mother, best friend Lilly (Heather Matarazzo) and Lilly's older brother Michael (Robert Schwartzman). Making it through high school without throwing up is a challenge in itself for Mia, so it doesn't come as welcome news when her estranged grandmother, Queen Clarisse Renaldi (Dame Julie Andrews), shows up out of the blue and calmly informs her that she is in fact the heir to the throne of a European country called Genovia. Suddenly Mia's life is thrown into complete overload. She's being taught about scarves, waves, and pears in order to become a perfect Princess, she gets a makeover and a tough looking, yet sweet bodyguard and limo driver called Joe (Hector Elizondo). Things get out of hand when the media gets a hold of the story and suddenly Mia is thrust into the spotlight in the newspapers and in school. On top of all of that, Mia has a choice to make. She must decide by Genovia's Independence Day Ball whether she longs to relinquish her claim on the throne or to become the Princess and heir to the throne her father, Philippe Renaldi (Rene Auberjonois), and grandmother want her to be.",slug:"the-princess-diaries"}}},books:{data:[{id:10658,attributes:{title:g,description:"Fourteen-year-old Mia, who is trying to lead a normal life as a teenage girl in New York City, is shocked to learn that her father is the Prince of Genovia, a small European principality, and that she is a princess and the heir to the throne.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hRHzngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2008-03-25",publisher:"HarperTeen",subtitle:b}},{id:10659,attributes:{title:"The Princess Diaries, Volume IV: Princess in Waiting",description:"The fourth book in the #1 New York Times bestselling Princess Diaries series by Meg Cabot. Never before has the world seen such a princess. Nor have her own subjects, for that matter. But Genovian politics are nothing next to Mia's real troubles. Between canceled dates with her long-sought-after royal consort, a second semester of the dreaded Algebra, more princess lessons from Grandmère, and the inability to stop gnawing on her fingernails, isn't there anything Mia is good at besides inheriting an unwanted royal title? Princess in Waiting is the fourth book in the beloved, bestselling series that inspired the feature film starring Anne Hathaway and Julie Andrews.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mxIp2yh5TvIC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:h,publisher:i,subtitle:b}},{id:10660,attributes:{title:"The Princess Diaries Collection",description:"For fans and new readers alike, a fantastic opportunity to own all ten \"Princess Diaries\" in one perfect boxed set!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=I4EDQgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2009-10-01",publisher:b,subtitle:b}},{id:10661,attributes:{title:"The Princess Diaries 4",description:b,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MwiOPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2008-05-01",publisher:"MACMILLAN",subtitle:b}},{id:10662,attributes:{title:"The Princess Diaries, Volume X: Forever Princess",description:"What's a Princess to do? It's Mia's senior year, and things seem great. She aced her senior project, got accepted to her dream college(s), and has her eighteenth birthday gala coming up . . . not to mention prom, graduation, and Genovia's first-ever elections. What's not to love about her life? Well . . . everyone adores her dreamy boyfriend, J.P., but Mia is not sure he's the one. Her first love, Michael, is back from Japan . . . and back in her life. That senior project? It's a romance novel she secretly wrote, and no one wants to publish it. And her father is losing in the Genovian polls—to Mia's loathsome cousin René! With not just Genovia's but her own future hanging in the balance, Mia's got some choices to make. And what she decides might determine not just the next four years but . . . forever!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OeugQ_X-CJsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:e,published:h,publisher:i,subtitle:b}}]}}},meta:{}}},prerenderedAt:1694069472032}}("movie","","Meg Cabot","series",null,1,"The Princess Diaries","2009-10-06","Harper Collins"))